import React from "react";

import Navbar from "../navbar/Navbar";
import Map_Nilgiris from "../maps/Map_Nilgiris";
function Nilgiris() {
  return (
    <div>
      <Navbar />
      <Map_Nilgiris />
    </div>
  );
}
export default Nilgiris;
